import React, { useState } from "react";
import axios from "axios";
import Navbar from "../navBar";

const AddLaboratory = () => {
  const [formData, setFormData] = useState({
    title: "",
    country: "",
    state: "",
    city: "",
    pincode: "",
    address: "",
  });

  const [message, setMessage] = useState("");
  const [error, setError] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage("");
    setError("");

    try {
      const response = await axios.post("http://localhost:8081/addLaboratory", formData);
      setMessage(response.data);
      setFormData({
        title: "",
        country: "",
        state: "",
        city: "",
        pincode: "",
        address: "",
      });
    } catch (err) {
      setError(err.response?.data || "Failed to add laboratory");
    }
  };

  return (
    <div className="main-wrapper">
      <Navbar />

      <div className="page-wrapper" style={{ marginTop: "50px" }}>
        {/* Main Content */}
        <div style={{ flex: 1, padding: "20px", backgroundColor: "#fff" }}>
          <h2
            style={{
              fontSize: "28px",
              marginBottom: "20px",
              borderBottom: "1px solid #ddd",
              paddingBottom: "10px",
            }}
          >
            Add Laboratory
          </h2>

          {/* Form Section */}
          <form
            onSubmit={handleSubmit}
            style={{
              display: "flex",
              flexWrap: "wrap",
              gap: "20px",
              maxWidth: "100%",
            }}
          >
            {/* First Row: 2 Fields */}
            {[
              { name: "title", type: "text", placeholder: "Title", row: 1 },
              { name: "country", type: "text", placeholder: "Country", row: 1 },
              { name: "state", type: "text", placeholder: "State", row: 2 },
              { name: "city", type: "text", placeholder: "City", row: 2 },
              {
                name: "pincode",
                type: "number",
                placeholder: "Pincode",
                row: 2,
              },
              {
                name: "address",
                type: "textarea",
                placeholder: "Address",
                row: 3,
              },
            ].map((field) => (
              <div
                key={field.name}
                style={{
                  flex:
                    field.row === 2
                      ? "1 1 calc(33.33% - 20px)"
                      : "1 1 calc(50% - 20px)",
                  minWidth: field.row === 3 ? "100%" : "200px",
                  display: "flex",
                  flexDirection: "column",
                  gap: "5px",
                }}
              >
                {field.type === "textarea" ? (
                  <textarea
                    name={field.name}
                    placeholder={field.placeholder}
                    value={formData[field.name]}
                    onChange={handleChange}
                    required
                    style={{
                      padding: "12px",
                      border: "1px solid #ccc",
                      borderRadius: "6px",
                      resize: "none",
                      fontSize: "14px",
                      height: "80px",
                    }}
                  ></textarea>
                ) : (
                  <input
                    type={field.type}
                    name={field.name}
                    placeholder={field.placeholder}
                    value={formData[field.name]}
                    onChange={handleChange}
                    required
                    style={{
                      padding: "12px",
                      border: "1px solid #ccc",
                      borderRadius: "6px",
                      fontSize: "14px",
                    }}
                  />
                )}
              </div>
            ))}

            {/* Submit Button */}
            <div
              style={{
                width: "100%",
                textAlign: "center",
                marginTop: "20px",
              }}
            >
              <button
                type="submit"
                style={{
                  padding: "12px 30px",
                  backgroundColor: "#2E37A4",
                  color: "white",
                  border: "none",
                  borderRadius: "6px",
                  cursor: "pointer",
                  fontSize: "16px",
                }}
              >
                Add Laboratory
              </button>
            </div>
          </form>

          {/* Success/Error Message */}
          {message && (
            <p
              style={{ color: "green", textAlign: "center", marginTop: "20px" }}
            >
              {message}
            </p>
          )}
          {error && (
            <p style={{ color: "red", textAlign: "center", marginTop: "20px" }}>
              {error}
            </p>
          )}
        </div>
      </div>
    </div>
  );
};

export default AddLaboratory;
